  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0112245 includes chemical,
  discrete sample, physical and profile data collected from Hokusei Maru in the North
  Pacific Ocean from 2000-07-29 to 2000-08-08 and retrieved during cruise 49HO20000729
  and HO00-3B. These data include ALKALINITY, AMMONIUM, DISSOLVED INORGANIC CARBON,
  DISSOLVED OXYGEN, HYDROSTATIC PRESSURE, NITRATE, NITRITE, PHOSPHATE, SALINITY, SILICATE,
  WATER TEMPERATURE and pH. The instruments used to collect these data include CTD,
  Coulometer for DIC measurement and bottle. These data were collected by Shuichi
  Watanabe of Hokkaido University as part of the PACIFICA_49HO20000729 data set.nnPACIFICA
  (PACIFic ocean Interior CArbon) was an international collaborative project for the
  data synthesis of ocean interior carbon and its related parameters in the Pacific
  Ocean. The North Pacific Marine Science Organization (PICES), Section of Carbon
  and Climate (S-CC) supported the project.\",\n\t\"license_title\": null,\n\t\"extras\":
